export const nakedPair = {
  name: "Naked Pair",
  check: (cell, state) => {
    let report = {
      solution: 0,
      notes: 0,
    };
    if (cell.suspects.size === 2) {
      report.notes = [];
      // ...return that value.
      report.notes.push({
        row: cell.row,
        col: cell.col,
        notes: [0, 0, 0, 0, 0, 0, 0, 0, 0],
      });
    }
    console.log("nakedPair" + cell + state);
    return report;
  },
};
